import React from 'react';

function Nav({filterItem}) {
    const [value, setValue] = React.useState();

const handleChange = (event, newValue) => {
    setValue(newValue);
  };
    return (
        <>
        <Box sx={{ width: '100%', bgcolor: 'background.paper' }}>
      <Tabs value={value} onChange={handleChange}  centered>
        <Tab onClick={() => filterItem("BreakFast")}  label="BreakFast" />
        <Tab  onClick={() => filterItem("Lunch")} label="Lunch" />
        <Tab  onClick={() => filterItem("Dinner")}  label="Dinner" />
      </Tabs>
    </Box>

        </>
    )
}

export default Nav
